(1, '', 10, 1583225675, 1583161405, 1, 0, 0, 0, 0, '', 3328, 0, 0, 0, 0, NULL, 0, , 0, 0, '', 0, 0, 0, 0, 0, 0, 'gridelements_pi1', '', '', NULL, 0, 0, 0, 0, 0, 0, 0, 2, 0, 0, '0', 'default', 0, 0, 0, '', '', NULL, NULL, 1, '', '', 0, '1', '', 1, 0, NULL, 0, '', '', '', 0, 0, 0, '<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"bgimage\">\n                    <value index=\"vDEF\">1</value>\n                </field>\n                <field index=\"paddingTop\">\n                    <value index=\"vDEF\">66.2</value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>', '', 0, '', NULL, '', '', NULL, 124, 0, 0, 0, 0, 0, 0, '0', 0, NULL, 0, -2, 'PanelImage', 2, 0, 0, 0, 0, NULL, 0),
(2, '', 10, 1583268851, 1583161479, 1, 0, 0, 0, 0, '', 2562, 0, 0, 0, 0, NULL, 0, 0x613a313a7b733a363a2268696464656e223b4e3b7d, 0, 0, '', 0, 0, 0, 0, 0, 0, 'text', 'Accueil', '', '\r\n<p>L’<strong> Association nationale des délégués du procureur de la République </strong>(A.N.D.P.R.) a été créée en mars 2017.</p>\r\n<p>Au sein de l’institution judiciaire, le délégué du Procureur de la République est un des acteurs principaux de la mise en œuvre des alternatives aux poursuites pénales. Il agit sous mandat du magistrat du Parquet. Il peut également se voir confier par ce magistrat d’autres missions dans la phase post-sentencielle (notifications d’ordonnances pénales, participations à des stages de sensibilisation, ….</p>\r\n<p>Présente dans presque tous les tribunaux judiciaires, l’A.N.D.P.R. permet des échanges d’expérience entre les délégués dans l’accomplissement de leurs missions et elle constitue une référence et un interlocuteur reconnus par les instances judiciaires dans le cadre de travaux relatifs à l’évolution de la fonction.</p>\r\n<p>Le site de l’Association (asdpr.org) offre à tous les délégués une source d’informations mises à jour régulièrement et des conseils pratiques pour mieux appréhender l’ensemble des missions qui leur sont confiées et l’environnement de leur fonction.</p>\r\n<p>Ce site s’adresse également à toutes celles et tous ceux qui recherchent des informations sur une fonction qu’ils souhaiteraient exercer.</p>\r\n\r\n<p>Vous souhaitez exercer la fonction de délégué du procureur de la République :</p>\r\n<p>Le recrutement des délégués du procureur de la République est de la compétence des procureurs de la République près les tribunaux judiciaires.</p>\r\n<p class=\"has-text-align-left\">Aussi, je vous invite à adresser votre candidature, accompagnée d’une lettre de motivation et d’un CV, au procureur de la République du tribunal judiciaire au sein duquel vous souhaiteriez exercer. En fonction de ses besoins, ce magistrat vous contactera afin de vous préciser la procédure. A préalable, vous pouvez consulter l’article R 15-33-33 du code de procédure pénale afin de vérifier si vous n’êtes pas dans une situation incompatible avec la fonction.</p>\r\n<p>La procédure consiste, après validation de votre candidature, en une prestation de serment devant la juridiction suivie d’une habilitation provisoire d’un an. A l’issue de cette période probatoire, l’habilitation est de cinq ans, renouvelable.</p>\r\n<p>La formation, non obligatoire, mais fortement recommandée, est assurée par l’Ecole nationale de la magistrature à Paris. Elle s’étend sur deux jours. Elle est prise en charge par la Cour d’appel de votre juridiction.</p>\r\n<p>Je vous souhaite de pouvoir exercer cette fonction passionnante et enrichissante, et, pourquoi pas, de nous rejoindre au sein de notre association nationale des délégués du procureur de la République (A.N.D.P.R.) – site&nbsp;: <a href=\"http://www.asdpr.org/\">www.asdpr.org</a>.</p>\r\n<p>Le président de l’A.N.D.P.R.</p>', 0, 0, 0, 0, 1, 0, 0, 2, 0, 0, '0', 'default', 0, 0, 0, '', '', NULL, NULL, -1, '', '', 0, '100', '', 1, 0, NULL, 0, '', '', '', 0, 0, 0, NULL, '', 0, '', NULL, '', '', NULL, 124, 0, 0, 0, 0, 0, 0, '0', 0, NULL, 0, -2, '0', 0, 9, 102, 0, 0, NULL, 0),
