(71, '', 8, 1583332285, 1583332277, 1, 0, 0, 0, 0, '', 256, 0, 0, 0, 0, NULL, 0, , 0, 0, '', 0, 0, 0, 0, 0, 0, 'textpic', '', '', '<p>Propulsé par <a href=\"https://www.helloasso.com\" rel=\"nofollow\">HelloAsso</a></p>\r\n<p>Pour les nouveaux adhérents, la carte de membre vous sera transmise par le trésorier après votre règlement.</p>\r\n<p class=\"has-text-color has-background has-vivid-red-color\">Pour les nouveaux membres, n’oubliez pas de remplir le formulaire d’adhésion (à transmettre par voie postale à ANDPR 20, rue de la Défense 93100 MONTREUIL), en cliquant <a href=\"http://asdpr.org/wp-content/uploads/2017/12/Bulletin-dadh%C3%A9sion.pdf\" rel=\"noreferrer noopener\" target=\"_blank\">ICI</a></p>', 0, 0, 0, 0, 0, 0, 0, 2, 0, 0, '0', 'default', 0, 0, 0, '', '', NULL, NULL, -1, '', '', 0, '0', '', 1, 0, NULL, 0, '', '', '', 0, 0, 0, NULL, '', 0, '', NULL, '', '', NULL, 124, 0, 0, 0, 0, 0, 0, '0', 0, NULL, 0, -2, '0', 0, 58, 102, 0, 0, NULL, 0);

